t = 1
def change(s):
    s_ = [[[s[z][y][x] for x in range(7)] for y in range(7)] for z in range(7)]
    for z in range(1,6):
        for y in range(1,6):
            for x in range(1,6):
                su = -s[z][y][x]
                for i in range(z-1,z+2):
                    for j in range(y-1,y+2):
                        for k in range(x-1,x+2):
                            su += s[i][j][k]
                if not s[z][y][x]:
                    if fa[su]:
                        s_[z][y][x] = 1
                else:
                    if not fb[su]:
                        s_[z][y][x] = 0
    return s_

