class Simulator:
    def __init__(self, exist_mp, cnt_mp, birth_num, death_num, limit):
        self.exist_mp = exist_mp
        self.cnt_mp = cnt_mp
        self.birth_num = birth_num
        self.death_num = death_num
        self.birth_list = []
        self.death_list = []
        self.limit = limit

    def check(self):
        self.birth_list = []
        self.death_list = []
        for z in range(1, 6):
            for y in range(1, 6):
                for x in range(1, 6):
                    if not self.exist_mp[z][y][x] and\
                       self.cnt_mp[z][y][x] in self.birth_num:
                        self.birth_list.append((x, y, z))
                    if self.exist_mp[z][y][x] and\
                       self.cnt_mp[z][y][x] not in self.death_num:
                        self.death_list.append((x, y, z))

    def birth(self):
        for x, y, z in self.birth_list:
            self.exist_mp[z][y][x] = 1
            self.cnt_mp[z][y][x] -= 1
            for nz in (z - 1, z, z + 1):
                for ny in (y - 1, y, y + 1):
                    for nx in (x - 1, x, x + 1):
                        self.cnt_mp[nz][ny][nx] += 1

    def death(self):
        for x, y, z in self.death_list:
            self.exist_mp[z][y][x] = 0
            self.cnt_mp[z][y][x] += 1
            for nz in (z - 1, z, z + 1):
                for ny in (y - 1, y, y + 1):
                    for nx in (x - 1, x, x + 1):
                        self.cnt_mp[nz][ny][nx] -= 1

    def run(self):
        while self.limit > 0:
            self.check()
            self.birth()
            self.death()
            self.limit -= 1

    def print_mp(self):
        for z in range(1, 6):
            for y in range(1, 6):
                print(*self.exist_mp[z][y][1:6],sep="")
            if z != 5:print()

